import React, {useState} from 'react';
import { SearchNumContaner } from './CardCar.styled';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './styles.css';

interface ChildComponentProps {
  setDataFromSearch: React.Dispatch<React.SetStateAction<string>>;
}

const ChildComponent: React.FC<ChildComponentProps> = ({ setDataFromSearch }) => {

  const [dataSearch, setdataSearch] = useState<string | " ">(" ");

  const sendDataToParent = () => {
    setDataFromSearch(dataSearch);
  };

  return (
    <SearchNumContaner>
      <Form.Label htmlFor="inputPassword5" id="LabelEnterNum">Введите номер</Form.Label>
      <div className='containerSearch'>
        <Form.Control type="text" id="inputPassword5" aria-describedby="passwordHelpBlock" onChange={ e => setdataSearch(e.target.value)} />
        <Button variant="success" onClick={sendDataToParent}>Поиск</Button>
      </div>
      <Form.Text id="passwordHelpBlock" className="passwordHelp">
          Номер должен соответствовать регламентам Украины
      </Form.Text>
    </SearchNumContaner>
  );
};

export default ChildComponent;
